
<!DOCTYPE html>
<html lang="id">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>Login | PT. CITRA SASTRA GRAFIKA</title>
  <style>
    * {
      box-sizing: border-box;
      margin: 0;
      padding: 0;
      font-family: 'Segoe UI', sans-serif;
    }

    body {
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
      background: none;
      padding: 20px;
      overflow: hidden;
    }

    #bgVideo {
      position: fixed;
      top: 0;
      left: 0;
      min-width: 100%;
      min-height: 100%;
      z-index: -1;
      object-fit: cover;
    }

    .login-box {
      background-color: rgba(255, 255, 255, 0.95);
      padding: 30px;
      border-radius: 16px;
      box-shadow: 0 12px 30px rgba(0, 0, 0, 0.2);
      max-width: 400px;
      width: 100%;
      text-align: center;
    }

    .login-box img {
      max-width: 100px;
      width: 100%;
      height: auto;
      margin-bottom: 16px;
    }

    .login-box h2 {
      margin-bottom: 10px;
      color: #333;
      font-size: 1.4rem;
      letter-spacing: 1px;
    }

    .login-box h3 {
      margin-bottom: 24px;
      color: #4b6cb7;
      font-size: 1rem;
      font-weight: normal;
    }

    .form-group {
      text-align: left;
      margin-bottom: 20px;
    }

    .form-group label {
      display: block;
      margin-bottom: 6px;
      font-weight: bold;
      color: #555;
    }

    .form-group input {
      width: 100%;
      padding: 12px;
      border: 1px solid #ccc;
      border-radius: 10px;
      transition: border-color 0.3s;
    }

    .form-group input:focus {
      border-color: #4b6cb7;
      outline: none;
    }

    .login-button {
      width: 100%;
      padding: 12px;
      border: none;
      background-color: #4b6cb7;
      color: white;
      font-weight: bold;
      border-radius: 10px;
      cursor: pointer;
      transition: background-color 0.3s;
    }

    .login-button:hover {
      background-color: #3a539b;
    }

    .footer-text {
      margin-top: 20px;
      font-size: 0.9em;
      color: #666;
    }

    @media (max-width: 480px) {
      .login-box {
        padding: 20px;
      }

      .login-box h2 {
        font-size: 1.2rem;
      }

      .login-box h3 {
        font-size: 0.9rem;
      }

      .login-box img {
        max-width: 80px;
      }
    }
  </style>
  <script>
    function validateLogin() {
      const user = document.getElementById('username').value.trim();
      const pass = document.getElementById('password').value.trim();
      if (user === 'aksesspvdika' && pass === '123') {
        window.location.href = 'https://www.chatbase.co/chatbot-iframe/xC4UNODh6Z_N6c5NrdqnJ';
        return false;
      } else {
        alert('Username atau password salah!');
        return false;
      }
    }
  </script>
